			shellPath = /bin/sh;
			shellScript = "#编译xib文件为nib,仅需要运行一次,然后xib文件即可删除,仅保留nib文件即可\n#XIB_FILES_PATH=${PROJECT_DIR}/${PRODUCT_NAME}/Libs/UMSocial_Sdk_3.0/SocialSDKXib\n#pushd ${XIB_FILES_PATH}\n#    for filename in `ls *.xib`\n#    do\n#        echo $filename\n#        base=\"${filename%.[^.]*}\"\n#        ibtool ${filename} --compile ${base}.nib\n#    done\n#popd\n\n#创建UMengCommonSDK.embeddedframework目录\nFRAMEWORKPATH=${PROJECT_DIR}/UMengCommon.embeddedframework\nif [ ! -d $FRAMEWORKPATH ]; then\nmkdir -p $FRAMEWORKPATH/Resources\nfi\n\n#复制中文字符串资源到根目录(解决Flex编译时未正确生成中文国际化问题)\ncp ${PROJECT_DIR}/${PRODUCT_NAME}/Libs/UMSocial_Sdk_3.0/zh-Hans.lproj/UMSocialLocalizable.strings $FRAMEWORKPATH/Resources\n\n#创建UMengCommonSDK.framework目录\nFRAMEWORKPATH=${PROJECT_DIR}/UMengCommon.embeddedframework/UMengCommon.framework\nif [ ! -d $FRAMEWORKPATH ]; then\nmkdir -p $FRAMEWORKPATH/Headers\nfi\n\n#复制UMengCommonSDK.framework所需的头文件\ncp ${PROJECT_DIR}/${PRODUCT_NAME}/UMengCommon.h $FRAMEWORKPATH/Headers\ncp ${PROJECT_DIR}/${PRODUCT_NAME}/UMengCommonConstants.h $FRAMEWORKPATH/Headers\n\n#复制库文件\ncp ${CONFIGURATION_BUILD_DIR}/libUMengCommonSDK.a $FRAMEWORKPATH/UMengCommon\n";
